import React from 'react';
import Main from './components/Main';
import BackgroundVideo from './components/Background';
import { BrowserRouter } from 'react-router-dom';

import './App.css';

function App() {
  return (
  <BrowserRouter >
  <div className='hoss'>
    <BackgroundVideo  />
    <Main/>
  </div>
  </BrowserRouter>
  );
}

export default App;
